    let NewImageArray = []
    let NewImage = {}
    for(let i = 0; images.length > i; i++){
      if(imageId.includes("God's Vineyard")){
        NewImage = {url : images[i].url, alt : images[i].alt}
        NewImageArray.push(NewImage)
        console.log(NewImage)
      }
    }
    
    
    const location = useLocation()
    console.log(location.pathname)

    const TeamGalleryPath = location.pathname

  return (
    <div className="flex flex-wrap justify-center">
      <App id={TeamGalleryPath} />
      {NewImageArray.map((image, index) => (
        <img
          key={index}
          src={image.url}
          alt={image.alt}
          className="w-96 h-96 object-cover m-4"
        />
      ))}
    </div>
  );
}

export default App;
